// Footer.js
import React from 'react';
import './Footer.css';

function Footer() {
  return (
    <footer className="footer">
      <div className="footer-links">
        <a href="#">About Us</a>
        <a href="#">Contact</a>
        <a href="#">Data Privacy</a>
        <a href="#">Terms of Collaboration</a>
      </div>
      <div className="footer-branding">
        <p>MakeTribe</p>
      </div>
    </footer>
  );
}

export default Footer;
